import React, { Component } from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { ListItemCardData } from "./ListItemCardData";
import { CardData } from "./CardData";
import { ReactComponent as GiftIcon } from "../assets/icons/gift.svg";
import { ReactComponent as NextIcon } from "../assets/icons/next.svg";

import {
  Container,
  Row,
  Col,
  Card,
  ListGroup,
  ListGroupItem,
} from "react-bootstrap";

// function Cards() {}

class Cards extends Component {
  render() {
    return (
      <>
        <style type="text/css">
          {`
     .col {
      width: auto;
     
      }

     .colCard {
       padding-right: 43px;
       padding-left: 0;
      }

  .card {
    border-radius: 4px 20px 20px 20px;
    border: 0px;
    box-shadow: 0px 10px 20px rgba(233, 216, 207, 0.3);
    width: 343px;
    height: 548px;
    
  }
  .card>.list-group:last-child {
    border-radius: 20px
  }

    .card-header  {
        color: #272931;
         background-color: #ffffff;
         height: 60px;
         border: 0px;
         justify-content: center;
         align-items: center;
      }

      .card-header:first-child {
        border-radius:  20px;
      }

      .card-img, .card-img-bottom, .card-img-top  {
        width: 315px;
        height: 160px;
        margin: 0px 14px;
      }

      .iconHeader {
        border-radius: 11px;
      }

      .header {
        flex-direction: row;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      .titleHeader {
        font-weight: bold;
        font-size: 14px;
        line-height: 16px;
        text-align: center;
        flex: 30%;
        display: grid;
        place-items: center;
      }

      .status{
        background: rgba(0, 198, 103, 0.08);
        border-radius: 8px;
        font-weight: 600;
        font-size: 13px;
        line-height: 15px;
        width: 90px;
        height: 30px;
        justify-content: center;
        align-items: center;
        // text-align: center;
        // font-feature-settings: 'pnum' on, 'lnum' on;
        color: #00C667;
        flex: 70%;
        display: grid;
        
      }

    `}
        </style>
        {/* <Row xs={1} md={2}> */}
        {CardData.map((item, key) => {
          return (
            <Col className="colCard">
              <Card key={key}>
                <Card.Header className="bg">
                  <div className="header">
                    {item.iconHeader}
                    <span className="titleHeader">{item.titleHeader}</span>
                    <span className="status">{item.status}</span>
                  </div>
                </Card.Header>
                <Card.Img
                  variant="top"
                  src={require(`../assets/${item.image}.png`)}
                />
                <Card.Body>
                  <Card.Title>{item.title}</Card.Title>
                  <Card.Text>
                    <GiftIcon />
                    {item.giftTitle}
                  </Card.Text>
                </Card.Body>
                {ListItemCardData.map((val, key) => {
                  return (
                    <ListGroup key={key} className="list-group-flush">
                      <ListGroupItem>
                        {val.item1}
                        <span>{item.item1}</span>
                        <NextIcon />
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item2}
                        <span>{item.item2}</span>
                        <NextIcon />
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item3}
                        <span>{item.item3}</span>
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item4}
                        <span>{item.item4}</span>
                      </ListGroupItem>
                    </ListGroup>
                  );
                })}
              </Card>
            </Col>
          );
        })}
        {/* </Row> */}
      </>
    );
  }
}

export default Cards;
